import React, { Component } from 'react';
import {
  Platform,
  Text,
  View,
  Linking,
  TextInput,
  Button,
  KeyboardAvoidingView,
  FlatList
} from 'react-native';

//import {NavigationContainer} from '@react-navigation/native'
import Header from './Components/header.js';

//import appStyles from './Sass/app.scss';
import chatStyles from './Sass/chat.scss';

export default class App extends Component {
  // static navigationOptions = {
  //   navigation: any,
  // };

  static navigationOptions = ({navigation}) => ({
    title:'Contacts',
    headerLeft: (
        <Button onPress={() =>  {
            navigation.navigate('Chat')
        }}
        />
    ),
});
  // FlatList, TextInput och Button bör kunna göras till en component (chatView) men det funkar inte nu
  render() {

    return (
      <View>
      <Header title={'Contacts'} />
      <Button title="Kalle Kula" onPress={() => alert('se konvo')}/>
      </View>
    );
  }
}

function Item({ msg }) {
  if (msg.recieved) {
    return (
      <View style={[chatStyles.msg, chatStyles.msgRecieved]}>
        <Text>{msg.message}</Text>
      </View>
    );
  }

  return (
    <View style={[chatStyles.msg, chatStyles.msgSent]}>
      <Text>{msg.message}</Text>
    </View>
  );
}

const DATA = [
  {
    user:
      'Kalle Kula',
    id: 0
  },

  {
    user:
      'Lisa Avlång',
    id: 1
  },

  {
    user:
      'Anna Asbra',
    id: 2
  },

  {
    user:
      'Fidde Framåt',
    id: 3
  }

];
